import React, { useState } from "react";
import { Link } from "react-router-dom";
import '../css/nav.css'

function Navbar(){
  return(
    <nav>
      <img src="./Recrash.png"/>
      <div>
        <h1>Home</h1>
        <h1>Map</h1>
        <h1>About</h1>
      </div>
    </nav>
  )
}
export default Navbar;
